export interface EnvConfig {
  apiUrl?: string;
  backgroundUrl?: string; // New field for the background image
}

const envConfig: EnvConfig = (window as any).__env || {};

export const environment = {
  production: false,
  apiUrl: envConfig.apiUrl || 'http://localhost:5000',
  backgroundUrl: envConfig.backgroundUrl || 'https://www.raystec.com/assets/img/rays/customLogoOuterglow.png' // Default image URL
};
